value.stringValue:
AND(
    NOT(
        OR(
            AND(
                NOT(ISNULL([Case].ProfileNameOwner__c)),
                CONTAINS([Case].ProfileNameOwner__c , "AAI - Vendite" )
            ),
            AND(
                NOT(ISNULL([Case].QueueNameOwner__c)),
                CONTAINS([Case].QueueNameOwner__c, "Coda_Agenzia_Case" )
            )

        )

    ),
    ISCHANGED([Case].Status),
    ISPICKVAL([Case].Status,"Closed") ,
    ISPICKVAL([Case].Complainant__c,"Customer"),
    NOT(
        ISPICKVAL([Case].Origin,"Phone")
    ),
    NOT( ISPICKVAL([Case].Origin,"Chat") ),
    NOT( ISPICKVAL([Case].Origin,"Facebook") ),
    NOT(ISPICKVAL([Case].Origin,"Twitter")),
    OR(
        [Case].RecordType.Name="Axa Assicurazioni",
        [Case].RecordType.Name="Quadra"
    ),
    OR(
        AND(
            NOT(
                ISBLANK([Case].SuppliedEmail)
            ),
            NOT(
                CONTAINS([Case].SuppliedEmail, "@axa.it")
            ),
            NOT(
                CONTAINS([Case].SuppliedEmail, "@ipsi.ie")
            )
        ),
        AND(
            NOT(
                ISBLANK([Case].Case_Contact_Email__c)
            ),
            NOT(
                CONTAINS([Case].Case_Contact_Email__c, "@axa.it")
            )
        ),
        AND(
            NOT(
                ISBLANK([Case].ContactEmail )
            ),
            NOT(
                CONTAINS([Case].SuppliedEmail, "@axa.it")
            )
        )
    )
)

